driver_PWM_AUTOGRAD: True
driver_PWM_OFS: 28         
driver_PWM_REG: 8          
driver_VHIGHFS: 0
driver_VHIGHCHM: 1

[stepper_z]  #z1
step_pin: PA8
dir_pin: PC9
enable_pin: !PA10
rotation_distance: 40         
gear_ratio: 80:12             
microsteps: 16
endstop_pin: probe: z_virtual_endstop
position_max: 505             
position_min: -1.5 #-10              
homing_speed: 10.0
homing_retract_dist: 5.0
homing_retract_speed: 10.0
second_homing_speed: 5.0

[tmc2209 stepper_z]  
uart_pin: PA9 
interpolate: true             
run_current: 1.2            
sense_resistor: 0.150          
uart_address:3
stealthchop_threshold: 999999

[stepper_z1] #z2
step_pin: PC6
dir_pin: !PD15
enable_pin: !PC8
rotation_distance: 40         
gear_ratio: 80:12            
microsteps: 16    

[tmc2209 stepper_z1]
uart_pin: PC7  
interpolate: true             
run_current:  1.2          
sense_resistor: 0.150         
uart_address:3
stealthchop_threshold: 999999

[stepper_z2]  #z3
step_pin: PA5
dir_pin: PA4
enable_pin: !PA7
rotation_distance: 40         
gear_ratio: 80:12             
microsteps: 16

[tmc2209 stepper_z2]
uart_pin: PA6
interpolate: true             
run_current: 1.2          
sense_resistor: 0.150          
uart_address:3
stealthchop_threshold: 999999

[stepper_z3]  #z4
step_pin: PB13
dir_pin: !PB12
enable_pin: !PB15
rotation_distance: 40         
gear_ratio: 80:12             
microsteps: 16                        

[tmc2209 stepper_z3]
uart_pin: PB14
interpolate: true            
run_current: 1.2                   
sense_resistor: 0.150         
uart_address:3
stealthchop_threshold: 999999

[adc_temperature extruder_thermistor]
temperature1:25
resistance1:1268.60
temperature2:180
resistance2:1920.98
temperature3:300
resistance3:2398.52

[extruder]
step_pin: extra_mcu:PA8   
dir_pin: extra_mcu:PA9
enable_pin:!extra_mcu:PA11   
rotation_distance: 6.5 
microsteps: 16                
full_steps_per_rotation: 200 
nozzle_diameter: 0.600        
filament_diameter: 1.75  
max_extrude_only_distance: 150     
max_extrude_cross_section: 60
max_extrude_only_velocity: 22
heater_pin:extra_mcu:PB7 
sensor_type:extruder_thermistor  
pullup_resistor: 11500
sensor_pin: extra_mcu:PA5  
min_temp: -0
max_temp: 310
max_power: 1.0
min_extrude_temp: 150
#control : pid
#pid_kp : 34.838
#pid_ki : 4.976
#pid_kd : 62.823
pressure_advance: 0.025
pressure_advance_smooth_time: 0.035

[tmc2209 extruder]
uart_pin: extra_mcu:PA12
interpolate: True
run_current: 0.8
hold_current: 0.3
uart_address:3
sense_resistor: 0.150

[verify_heater extruder]      
max_error: 120                
check_gain_time:30           
hysteresis: 10              
heating_gain: 2          

[thermistor bed_thermistor]
temperature1: 25
resistance1: 100000
temperature2: 50
resistance2: 18085.4
temperature3: 100
resistance3: 5362.6

[heater_bed]
heater_pin: PD12
sensor_type: bed_thermistor  
sensor_pin: PC5
max_power: 1.0               
min_temp: -0            
max_temp: 110              
#control : pid
#pid_kp : 73.571
#pid_ki : 1.820
#pid_kd : 783.849

[verify_heater heater_bed]      
max_error: 120                
check_gain_time: 90           
hysteresis: 10               
heating_gain: 1 

